===Noun===
{{en-noun}}

# {{senseid|en|Q23622}} A [[reference work]] listing [[word]]s or [[name]]s from one or more [[language]]s, usually ordered [[alphabetically]], explaining each word's [[meaning#Noun|meanings]] or {{l|en|sense|id=any particular meaning of a word|senses}}, oftentimes also containing information on its [[etymology#Noun|etymology]], [[pronunciation#Noun|pronunciation]], {{l|en|usage|id=language}}, [[Wiktionary:Semantic relations|semantic relations]], [[translation#Noun|translations]], as well as other relevant information. {{defdate|ca. 1480}}
#: {{syn|en|Thesaurus:dictionary}}
#: {{hyper|en|wordbook}}
#: {{cot|en|thesaurus}}
#: {{ux|en|If you want to know the meaning of a word, look it up in the '''dictionary'''.}}
#* {{quote-book|en|year=1988|author=Andrew Radford|title=Transformational grammar: a first course|location=Cambridge, UK|publisher=Cambridge University Press|page=339|chapter=7|passage=But what other kind(s) of syntactic information should be included in Lexical Entries? Traditional '''dictionaries''' such as Hornby's (1974) ''Oxford Advanced Learner's '''Dictionary''' of Current English'' include not only ''categorial'' information in their entries, but also information about the range of ''Complements'' which a given item permits (this information is represented by the use of a number/letter code).}}
# {{lb|en|by extension}} A [[reference work]] on a particular [[subject]] or [[activity]] in which the entries are arranged alphabetically; an [[alphabetical]] [[encyclopedia]]. {{defdate|from 1570s}}
#: {{uxi|en|a '''law''' dictionary}}
#: {{uxi|en|a dictionary of '''sports'''}}
# {{lb|en|figurative}} A [[person]] or [[thing]] regarded as a [[repository]] or [[compendium]] of [[information]]. {{defdate|from 1730s}}
# {{lb|en|with {{m|en|of}} or possessive|frequently|figurative|especially|disparaging}} The [[collection]] of [[word]]s used or understood by a particular [[person]]; [[vocabulary]]. {{defdate|from 1570s}}
# {{lb|en|preceded by {{m|en|the}}}} A [[synchronic]] dictionary of a standardised language held to only contain words that are properly part of the language.
#* {{RQ:Lindsay Redheap|chapter=6|section=I|page=106|passage=Look it up in the '''dictionary''', and what do you find?}}
#* {{quote-book|en|year=2019|author=John Hughes|title=Life Pre-Intermediate Student's Book|publisher=National Geographic Learning|page=188|passage=By 1986 the name Walkman was included  as a word in the English '''dictionary'''.}}
# {{lb|en|computing}} An [[associative array]], a data structure where each value is referenced by a particular key, analogous to words and definitions in a dictionary ({{senseno|en|Q23622}}). {{defdate|from 1950s}}
#: {{hyponyms|en|hash table}}
#* {{quote-book|en|year=2011|author=Jon Galloway; Phil Haack; Brad Wilson|title=Professional ASP.NET MVC 3|passage=User calls <code>RouteCollection.GetVirtualPath</code>, passing in a <code>RequestContext</code>, a '''dictionary''' of values, and an optional route name used to select the correct route to generate the URL.}}

